import * as React from 'react';

import './Home.css';
import Courses from "../components/Cards";
import Navbar from "../components/Navbar"

import { Link } from 'react-router-dom';
import './Home.css';

import { FaHome, FaUser, FaUsers, FaCogs, FaClipboard, FaHospital, FaListAlt, FaTabletAlt, FaFileMedical } from 'react-icons/fa';
import { MdLocalPharmacy } from 'react-icons/md';

import {Sidebar} from "react-sidebar"

const menus = [
  {
    title: 'Home',
    icon: <Home/>,
    path: '/home',
  },
  {
    title: 'Chats',
   
    path: '/chats',
    subMenu: [
      {
        value: 'Chat 1',
        subPath: '/chats/chat1',
      },
      {
        value: 'Chat 2',
        subPath: '/chats/chat2',
      },
    ],
  },
  {
    title: 'Analytics',
   
    path: '/analytics',
  },
];


function Home (){
    return(
        <>
        
        <div>
        <Sidebar menus={menus}/>
      </div>
          
        </>
    )
}

export default Home;
